/* global google */
import axios from "axios";
import { useState, useEffect, useRef } from "react";
import { useNavigate, useParams } from "react-router-dom";
import Swal from "sweetalert2";

const URI = 'http://localhost:8000/createCancha';
const URICNCE = 'http://localhost:8000/getCanchaDeportivo'; //Checar Numero de Cancha Existente

const CompCreateCancha = () => {
    const navigate = useNavigate();
    const { ID_Deportivo, coordsParam, RFC_CURP } = useParams();
    const [Tipo_Cancha, setTipoCancha] = useState('Fútbol');
    const [Numero_Cancha, setNumeroCancha] = useState('');
    const [Material_Piso, setMaterialPiso] = useState('Césped');
    const [Techado, setTechado] = useState(false);
    const [Con_Gradas, setConGradas] = useState(false);
    const [Estado, setEstado] = useState('Buena Condición');
    const [Capacidad_Jugadores, setCapacidadJugadores] = useState('');
    const [formErrors, setFormErrors] = useState({});
    const [Coordenadas, setCoordenadas] = useState('');
    const [center, setCenter] = useState(null);
    const [marker, setMarker] = useState(null);
    const [map, setMap] = useState(null);

    // Coordenadas iniciales
    const [lat, long] = coordsParam.split(',');
    const initialCenter = { lat: parseFloat(lat), lng: parseFloat(long) };

    useEffect(() => {
        // Cargar dinámicamente el script de Google Maps
        const script = document.createElement('script');
        script.src = `https://maps.googleapis.com/maps/api/js?key=YOUR_API_KEY&libraries=places`;
        script.async = true;
        script.defer = true;

        script.onload = () => {
            // Crear mapa después de que el script se haya cargado
            const newMap = new google.maps.Map(document.getElementById("map"), {
                center: initialCenter,
                zoom: 17,
            });

            // Agregar evento de clic en el mapa
            newMap.addListener("click", (event) => {
                const newMarker = {
                    lat: event.latLng.lat(),
                    lng: event.latLng.lng(),
                };
                setMarker(newMarker);
                setCoordenadas(`${newMarker.lat}, ${newMarker.lng}`);
            });

            setMap(newMap);
        };

        document.body.appendChild(script);

        // Eliminar el script del DOM cuando el componente se desmonte
        return () => {
            document.body.removeChild(script);
        };
    }, []);

    useEffect(() => {
        if (map && marker) {
            new google.maps.Marker({
                position: marker,
                map: map,
            });
        }
    }, [marker]);

    const showErrorAlert = (message) => {
        Swal.fire({
            icon: 'error',
            title: 'Error',
            text: message,
            confirmButtonText: 'OK'
        });
    };

    const store = async (e) => {
        e.preventDefault();
        try {
            await axios.post(URI, {
                Tipo_Cancha,
                Numero_Cancha,
                Material_Piso,
                Techado,
                Con_Gradas,
                Estado,
                Capacidad_Jugadores,
                ID_Deportivo,
                Coordenadas,
            });
            Swal.fire("Éxito", "La cancha fue creada correctamente.", "success");
            navigate(`/showDeportivos/enc/${RFC_CURP}`);
        } catch (error) {
            console.error("Error al crear la cancha:", error);
            showErrorAlert("Hubo un error al crear la cancha. Inténtalo de nuevo.");
        }
    };

    return (
        <div className="formulario">
            <h1>Ingresar nueva cancha</h1>
            <form onSubmit={store}>
                <div className="form-group">
                    <label><strong>Coordenadas (Latitud, Longitud)</strong></label>
                    <input
                        type="text"
                        value={Coordenadas}
                        onChange={(e) => setCoordenadas(e.target.value)}
                        className="form-control"
                        required
                        disabled
                    />
                </div>
                <div id="map" style={{ height: "500px", width: "100%" }}></div>
                <div className="form-group">
                    <label>Tipo Cancha</label>
                    <select value={Tipo_Cancha} onChange={(e) => setTipoCancha(e.target.value)} className="form-control">
                        <option value="Fútbol">Fútbol</option>
                        <option value="Básquetbol">Básquetbol</option>
                        <option value="Voleibol">Voleibol</option>
                        <option value="Tenis">Tenis</option>
                    </select>
                </div>
                <div className="form-group">
                    <label>Numero de Cancha</label>
                    <input
                        type="text"
                        value={Numero_Cancha}
                        onChange={(e) => setNumeroCancha(e.target.value)}
                        className="form-control"
                    />
                </div>
                <button type="submit" className="btn btn-primary">Crear Cancha</button>
            </form>
        </div>
    );
};

export default CompCreateCancha;
